		style += 'padding:1px;margin:0 0 5px 0';

		if (this.outputCount % 2 === 0) {
			style += ";background-color:#101010";
		}

		message = message || "undefined";
		message = message.toString();

		this.outputElement.innerHTML += "<pre style='" + style + "'>" + message + "</pre>";

